// FirebaseTest.js - Enhanced debugging version
import React, { useState } from 'react';
import { initializeApp } from 'firebase/app';
import { getFirestore, collection, addDoc, serverTimestamp, connectFirestoreEmulator } from 'firebase/firestore';

const FirebaseTest = () => {
  const [status, setStatus] = useState('Ready to test');
  const [error, setError] = useState(null);
  const [logs, setLogs] = useState([]);

  const addLog = (message) => {
    console.log(message);
    setLogs(prev => [...prev, `${new Date().toLocaleTimeString()}: ${message}`]);
  };

  // Your exact Firebase config
  const firebaseConfig = {
    apiKey: "AIzaSyBERr5NV_1TszM1VwxUAIEA57LWgcG21pc",
    authDomain: "nevloh-website.firebaseapp.com",
    projectId: "nevloh-website",
    storageBucket: "nevloh-website.firebasestorage.app",
    messagingSenderId: "984849142454",
    appId: "1:984849142454:web:f60c2a9eca53d42f3fcc17"
  };

  const testFirebase = async () => {
    setStatus('Testing...');
    setError(null);
    setLogs([]);

    try {
      addLog('🔥 Starting Firebase test...');
      addLog(`📋 Project ID: ${firebaseConfig.projectId}`);
      addLog(`🌐 Auth Domain: ${firebaseConfig.authDomain}`);

      addLog('🔥 Initializing Firebase app...');
      const app = initializeApp(firebaseConfig, 'test-app-' + Date.now());
      addLog('✅ Firebase app initialized');

      addLog('🔥 Getting Firestore instance...');
      const db = getFirestore(app);
      addLog('✅ Firestore instance created');

      addLog('📝 Preparing test document...');
      const testData = {
        message: 'Test from Firebase debugging',
        timestamp: serverTimestamp(),
        testId: Date.now(),
        userAgent: navigator.userAgent,
        location: window.location.href
      };
      addLog(`📋 Test data: ${JSON.stringify(testData, null, 2)}`);

      addLog('💾 Creating collection reference...');
      const testCollection = collection(db, 'debug_test');
      addLog('✅ Collection reference created');

      addLog('🚀 Adding document to Firestore...');

      // Set a timeout to catch hanging requests
      const timeoutPromise = new Promise((_, reject) => {
        setTimeout(() => reject(new Error('Request timeout after 10 seconds')), 10000);
      });

      const addDocPromise = addDoc(testCollection, testData);

      const docRef = await Promise.race([addDocPromise, timeoutPromise]);

      addLog('✅ Document successfully written!');
      addLog(`📄 Document ID: ${docRef.id}`);
      setStatus(`✅ Success! Document ID: ${docRef.id}`);

    } catch (error) {
      addLog(`❌ Error occurred: ${error.message}`);
      addLog(`❌ Error code: ${error.code || 'No code'}`);
      addLog(`❌ Error details: ${JSON.stringify(error, null, 2)}`);
      console.error('Full error object:', error);
      setError(error.message);
      setStatus('❌ Failed');
    }
  };

  const checkNetworkConnectivity = async () => {
    setLogs([]);
    addLog('🌐 Testing network connectivity...');

    try {
      addLog('📡 Testing general internet connection...');
      const response = await fetch('https://www.google.com/favicon.ico', {
        mode: 'no-cors',
        timeout: 5000
      });
      addLog('✅ Internet connection OK');

      addLog('🔥 Testing Firebase API connectivity...');
      const firebaseResponse = await fetch('https://firestore.googleapis.com/v1/projects/nevloh-website/databases/(default)/documents', {
        method: 'GET',
        headers: {
          'Authorization': `Bearer ${firebaseConfig.apiKey}` // This won't work but will test connectivity
        }
      });
      addLog(`📡 Firebase API response status: ${firebaseResponse.status}`);

    } catch (error) {
      addLog(`❌ Network test failed: ${error.message}`);
    }
  };

  return (
    <div className="p-8 max-w-2xl mx-auto bg-white rounded-lg shadow-lg">
      <h2 className="text-2xl font-bold mb-4">Firebase Connection Test</h2>

      <div className="mb-4">
        <p className="font-semibold">Status:</p>
        <p className={`p-2 rounded ${
          status.includes('✅') ? 'bg-green-100 text-green-800' : 
          status.includes('❌') ? 'bg-red-100 text-red-800' : 
          'bg-blue-100 text-blue-800'
        }`}>
          {status}
        </p>
      </div>

      {error && (
        <div className="mb-4">
          <p className="font-semibold">Error:</p>
          <p className="p-2 bg-red-100 text-red-800 rounded text-sm">
            {error}
          </p>
        </div>
      )}

      <div className="flex gap-2 mb-4">
        <button
          onClick={testFirebase}
          className="flex-1 bg-blue-600 text-white py-2 px-4 rounded hover:bg-blue-700"
        >
          Test Firebase
        </button>
        <button
          onClick={checkNetworkConnectivity}
          className="flex-1 bg-gray-600 text-white py-2 px-4 rounded hover:bg-gray-700"
        >
          Test Network
        </button>
      </div>

      {/* Debug Logs */}
      {logs.length > 0 && (
        <div className="mb-4">
          <p className="font-semibold mb-2">Debug Logs:</p>
          <div className="bg-black text-green-400 p-3 rounded text-xs max-h-60 overflow-y-auto font-mono">
            {logs.map((log, index) => (
              <div key={index}>{log}</div>
            ))}
          </div>
        </div>
      )}

      <div className="text-xs text-gray-600 border-t pt-4">
        <p><strong>Project ID:</strong> {firebaseConfig.projectId}</p>
        <p><strong>Auth Domain:</strong> {firebaseConfig.authDomain}</p>
        <p><strong>Current URL:</strong> {window.location.href}</p>
        <p><strong>User Agent:</strong> {navigator.userAgent.substring(0, 50)}...</p>
      </div>
    </div>
  );
};

export default FirebaseTest;
